import React, { Component } from 'react';
import Header from './Header';
import "./../App.css";
import Footer from './Footer';
import Content from './Content';


class App extends Component {

  render() {
    return (
      <div className="container-fluid">
        <Header></Header>
        {/* <Content></Content> */}
        <div class="card" style={{ width: "350px", height: "150px" }}>
          <div className="row">
            <div className="col-5" ><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/12/User_icon_2.svg/220px-User_icon_2.svg.png" style={{ height:"140px", borderRadius:"50%", marginTop:"7px"}}/></div>
            <div className="col-7">
              <div>Name:</div>
              <div>Email:</div>
              <button type="button" name="" id="" class="btn btn-primary"></button>
            </div>

          </div>
        </div>
        <Footer></Footer>
      </div>
    )

  }
}

export default App;
